import React, { Fragment } from 'react'
import Main from './Main'
import {Link} from 'react-router-dom'
import Popup from "reactjs-popup";
    

const Resume = ()=>

 {

    return( 
        <div className="resume-page">
        <Main/>
       <div className="container-fluid">
       <div className="row">
       <div className="col-sm-6 resume-text-a">
       <h1><u style={{"color":"#ffff","line-height":"1","font-family": "monospace"}}>Education</u></h1>
       <br/>
       <h4>SATYA COLLEGE OF ENGINEERING AND TECHNOLOGY</h4>
       <br/>
       <p>  M.D.U,Rohtak | B-Tech ( Computer Science ) | Delhi Ncr, Haryana |  May 2010 - Sept 2014</p>
       
       </div>
       <div className="col-sm-6 resume-text-b">
       <h1><u style={{"color":"#ffff","line-height":"1","font-family": "monospace"}}>Experience</u></h1>
       <br/>
       <h4>SOURCE ONE MANAGEMENT PVT LTD</h4>
       <br/>
       <p>  Software Engineer | BTM, Bangalore | 
       March 2015 - July 2016</p><Link >Learn more</Link>
       </div>
       </div>       
       </div>
        </div>
    )
    
}
export default  Resume;


export class Example extends Component {
    openPopupbox() {
      const content = (
        <div>
          <p className="quotes">Work like you don't need the money.</p>
          <p className="quotes">Dance like no one is watching.</p>
          <p className="quotes">And love like you've never been hurt.</p>
          <span className="quotes-from">― Mark Twain</span>
        </div>
      )
      PopupboxManager.open({ content })
    }

    render() {
      return (
        <div>
          <button onClick={this.openPopupbox}>Click me</button>
          <PopupboxContainer />
        </div>
      )
    }
  }
